import React, { useState, useEffect } from 'react'
import Papa from 'papaparse';
import { csv } from 'd3';
// import csv from '../../../public/alkoholilupa_toimipaikkatiedot_34.csv'
// NIMI ;OSOITE;POSTINUMERO;POSTITOIMIPAIKKA;KUNTA;LUVANALKUPVM;LUPATYYPPI;Y-TUNNUS: "Aalto-sali;V�in�nkatu 7;40100;Jyv�skyl�;Jyv�skyl�;01.05.2018;Ennakkoon hyv�ksytty anniskelualue;0174708-5"

export default function TableCsv() {
  const [highlighted, setHighlighted] = React.useState(false);
  const [data, setData] = useState<any>([]);
  const [contacts, setContacts] = React.useState([
    { email: "fake@gmail.com", name: "Fake" },
  ]);
  useEffect(() => {
    const url: any = '/alkoholilupa_toimipaikkatiedot_34.csv';
    csv(url).then((data: any) => {
      console.log("DATA CSV", data);
      console.log(" CSV", data.columns);
      console.log(" data", data[0]);
      setData(data)
    });
  }, [])


  return (
    <div className="card ">
      <div className="card-header">
        <h4 className="card-title"> Simple Table</h4>
        {typeof (data.columns)}
        {(data.columns)}
        <div
          className={`p-6 my-2 mx-auto max-w-md border-2 ${
            highlighted ? "border-green-600 bg-green-100" : "border-gray-600"
            }`}
          onDragEnter={() => {
            setHighlighted(true);
          }}
          onDragLeave={() => {
            setHighlighted(false);
          }}
          onDragOver={(e) => {
            e.preventDefault();
          }}
          onDrop={(e) => {
            e.preventDefault();
            setHighlighted(false);

            Array.from(e.dataTransfer.files)
              .filter((file) => file.type === "text/csv")
              .forEach(async (file) => {
                const text = await file.text();
                const result = parse(text, { header: true });
                setContacts((existing) => [...existing, ...result.data]);
              });
          }}
        >
          DROP HERE
      </div>
      </div>
      <div className="card-body">
        <div className="table-responsive">
          <table className="table tablesorter " id="">
            <thead className=" text-primary">
              <tr>
                {data.columns && data.columns.map((name: string, i: number) => (
                  <th key={i}>name</th>
                ))}
                <th>Country</th>
                <th>City</th>
                <th className="text-center">Salary</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>Dakota Rice</td>
                <td>Niger</td>
                <td>Oud-Turnhout</td>
                <td className="text-center">$36,738</td>
              </tr>
            </tbody>
          </table>
        </div>
        <div className="card-body">
          <div className="table-responsive">
            <table className="table tablesorter " id="">
              <thead className=" text-primary">
                <tr>
                  <th>Name</th>
                  <th>Country</th>
                  <th>City</th>
                  <th className="text-center">Salary</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>Dakota Rice</td>
                  <td>Niger</td>
                  <td>Oud-Turnhout</td>
                  <td className="text-center">$36,738</td>
                </tr>
                <tr>
                  <td>Minerva Hooper</td>
                  <td>Curaçao</td>
                  <td>Sinaai-Waas</td>
                  <td className="text-center">$23,789</td>
                </tr>
                <tr>
                  <td>Sage Rodriguez</td>
                  <td>Netherlands</td>
                  <td>Baileux</td>
                  <td className="text-center">$56,142</td>
                </tr>
                <tr>
                  <td>Philip Chaney</td>
                  <td>Korea, South</td>
                  <td>Overland Park</td>
                  <td className="text-center">$38,735</td>
                </tr>
                <tr>
                  <td>Doris Greene</td>
                  <td>Malawi</td>
                  <td>Feldkirchen in Kärnten</td>
                  <td className="text-center">$63,542</td>
                </tr>
                <tr>
                  <td>Mason Porter</td>
                  <td>Chile</td>
                  <td>Gloucester</td>
                  <td className="text-center">$78,615</td>
                </tr>
                <tr>
                  <td>Jon Porter</td>
                  <td>Portugal</td>
                  <td>Gloucester</td>
                  <td className="text-center">$98,615</td>
                </tr>
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  )
}
